import React, { Component } from 'react';
import Client from './Client';


class Clients extends Component {
    render() {
        return (<div>
            <div id="clientsHeader"><span>Name</span> <span>Surname</span> <span>Country</span> <span></span></div>
            {this.props.clients.map(c => <Client client={c}/>)}
        </div>)
    }
}
export default Clients;
